/*Table structure for table `payment_currency` */

DROP TABLE IF EXISTS `payment_currency`;

CREATE TABLE `payment_currency` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `paymentId` int(11) unsigned NOT NULL,
  `currencyId` int(11) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `payment_currency_ibfk_1` (`currencyId`),
  KEY `payment_currency_ibfk_2` (`paymentId`),
  CONSTRAINT `payment_currency_ibfk_1` FOREIGN KEY (`currencyId`) REFERENCES `currencies` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `payment_currency_ibfk_2` FOREIGN KEY (`paymentId`) REFERENCES `payments` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `payment_currency` */

insert  into `payment_currency`(`id`,`paymentId`,`currencyId`) values (4,2,3),(6,2,2),(12,1,1),(13,1,3),(14,3,2),(15,3,4),(16,4,1),(17,4,2),(18,4,3),(19,5,2),(20,5,4),(21,5,5);

/*Table structure for table `payments` */

DROP TABLE IF EXISTS `payments`;

CREATE TABLE `payments` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `active` char(1) COLLATE utf8_bin NOT NULL DEFAULT 'Y',
  `paymentSystem` varchar(100) COLLATE utf8_bin NOT NULL,
  `position` smallint(6) unsigned NOT NULL DEFAULT '1',
  `name` varchar(100) COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `payments` */

insert  into `payments`(`id`,`active`,`paymentSystem`,`position`,`name`) values (1,'Y','webmoney',2,'Webmoney'),(2,'Y','free',2,'Free'),(3,'Y','robokassa',1,'Robokassa'),(4,'Y','paypal',3,'Paypal'),(5,'Y','qiwi',4,'Qiwi');

/*Table structure for table `permissions` */

DROP TABLE IF EXISTS `permissions`;

CREATE TABLE `permissions` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `display_name` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

