/*Table structure for table `products` */

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `categoryId` int(11) unsigned DEFAULT NULL,
  `brandId` int(11) unsigned DEFAULT NULL,
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `slug` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `price` int(11) unsigned DEFAULT NULL,
  `active` enum('Y','N') CHARACTER SET utf8 COLLATE utf8_bin DEFAULT 'Y',
  `sku` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `quantity` int(11) unsigned DEFAULT '0',
  `availability` enum('Y','N') CHARACTER SET utf8 COLLATE utf8_bin DEFAULT 'Y',
  `autoDecreaseQuantity` enum('Y','N') CHARACTER SET utf8 COLLATE utf8_bin DEFAULT 'Y',
  `viewsCount` int(11) unsigned DEFAULT NULL,
  `createdAt` datetime DEFAULT NULL,
  `updatedAt` datetime DEFAULT NULL,
  `addedToCartCount` int(11) unsigned DEFAULT NULL,
  `rating` int(11) unsigned DEFAULT NULL,
  `shortDescription` tinytext COLLATE utf8_unicode_ci,
  `fullDescription` text COLLATE utf8_unicode_ci,
  `attributeValues` text COLLATE utf8_unicode_ci,
  PRIMARY KEY (`id`),
  UNIQUE KEY `url` (`slug`),
  KEY `price` (`price`),
  KEY `is_active` (`active`),
  KEY `sku` (`sku`),
  KEY `created` (`createdAt`),
  KEY `updated` (`updatedAt`),
  KEY `added_to_cart_count` (`addedToCartCount`),
  KEY `views_count` (`viewsCount`),
  KEY `FK_store_product_category` (`categoryId`),
  KEY `brand_id` (`brandId`),
  KEY `availability` (`availability`),
  KEY `rating` (`rating`),
  FULLTEXT KEY `attributeValues` (`attributeValues`)
) ENGINE=InnoDB AUTO_INCREMENT=53 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

