/*Table structure for table `rating` */

DROP TABLE IF EXISTS `rating`;

CREATE TABLE `rating` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `product_id` int(11) unsigned NOT NULL,
  `user_id` int(11) unsigned NOT NULL,
  `value` tinyint(3) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `good_id` (`product_id`,`user_id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `rating` */

insert  into `rating`(`id`,`product_id`,`user_id`,`value`) values (1,1,2,4),(2,2,2,4),(3,3,2,3),(4,23,2,5),(5,22,2,5),(6,4,2,4),(7,5,2,2),(8,6,1,4),(9,7,2,5),(10,8,1,2),(11,9,1,5),(12,10,1,4),(13,11,2,4),(14,32,1,3);

/*Table structure for table `rating_desc` */

DROP TABLE IF EXISTS `rating_desc`;

CREATE TABLE `rating_desc` (
  `id` tinyint(3) unsigned NOT NULL,
  `desc` varchar(50) COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `rating_desc` */

insert  into `rating_desc`(`id`,`desc`) values (1,'Ужасный товар'),(2,'Плохой товар'),(3,'Терпимо, но могло быть и лучше'),(4,'Хороший товар'),(5,'Отличный товар');

/*Table structure for table `related_product` */

DROP TABLE IF EXISTS `related_product`;

CREATE TABLE `related_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NOT NULL,
  `related_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `product_id` (`product_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Handle related products';

/*Data for the table `related_product` */

/*Table structure for table `reviews` */

DROP TABLE IF EXISTS `reviews`;

CREATE TABLE `reviews` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `productId` int(11) unsigned NOT NULL,
  `userId` int(11) unsigned NOT NULL,
  `content` text NOT NULL,
  `moderated` enum('Y','N') NOT NULL DEFAULT 'N',
  `createdAt` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `product_id` (`productId`),
  KEY `user_id` (`userId`),
  KEY `moderated` (`moderated`),
  KEY `createdAt` (`createdAt`)
) ENGINE=InnoDB AUTO_INCREMENT=104 DEFAULT CHARSET=utf8;

